func TestHeadingDelta(t *testing.T) {
	//-73.43955486902293, 45.57520659584327
	//-73.43980859833134, 45.57504515375223
	c1 := NewCoordinate(-73.43955486902293, 45.57520659584327)
	c2 := NewCoordinate(-73.43980859833134, 45.57504515375223)

	carH := 230.0
	h := c1.HeadingTo(c2)
	hr := c2.HeadingTo(c1)

	d1 := h - carH
	d2 := hr - carH

	if (d1 > 30 && d1 < 0) || (d1 > 165 && d1 < 195) {

	}
	fmt.Println("Heading:", h, hr, d1, d2)

}

func TestClosestWay(t *testing.T) {

	col := &geojson.FeatureCollection{}
	err := json.Unmarshal([]byte(coordinatesJson), col)
	require.NoError(t, err)

	var coordinates []*Coordinate
	for _, feature := range col.Features {
		c := NewCoordinate(feature.Geometry.Point[0], feature.Geometry.Point[1])
		w, err := strconv.Atoi(feature.Properties["way"].(string))
		require.NoError(t, err)
		c.Way = int64(w)
		coordinates = append(coordinates, c)

	}
	//
	//coordinates := []*Coordinate{
	//	NewCoordinate(-73.4391432, 45.5744076),         //closest
	//	NewCoordinate(-73.4382193, 45.574189800000006), //expected other
	//	NewCoordinate(-73.43943510000001, 45.5745458),  //to far
	//}

	heading := 288.78218000000004
	//point := NewCoordinate(-73.4386663807796, 45.57434716564532)
	point := NewCoordinate(-73.43881903485153, 45.574390911769214)

	cps := ClosestPoint(point, coordinates)
	//fmt.Println("Closest points:", cps[0], cps[1])
	closest, otherClosest := ClosestWay(cps, point, heading, coordinates)

	fmt.Println("Closest point:", closest, otherClosest)
}

